description:
राष्ट्रिय परीक्षा बोर्डले यस वर्षको कक्षा १० को अन्तिम परीक्षा अर्थात् माध्यमिक शिक्षा परीक्षा (एसइई) चैत १९ गतेदेखि २९ गतेसम्म देशभर एकैसाथ सञ्चालन गर्ने भएको छ ।
&amp;nbsp;&amp;nbsp; &amp;nbsp;
बोर्डले आज एसइई परीक्षाको तालिका सार्वजनिक गर्दै आउँदो

ओखलढुंगाको चुनावी राजनीतिमा नाटकीय फेरबदल आएको छ ।&amp;nbsp;

नेकपा (एमाले)ले कोशी प्रदेशका पूर्वमन्त्री अम्बिरबाबु गुरुङलाई टिकट नदिई युवा नेता अस्मिता थापालाई अघि सारेपछि उनले विद्रोह गर्दै पार्टी परित्याग गरे ।&amp;nbsp;

तर, एमाले छाडेर नेपाली कम

मकवानपुरमा करिब १२१ किलो चरेससहित दुई जना पक्राउ परेका छन् ।&amp;nbsp;

थाहा नगरपालिका-१० टौखेलबाट अवैध लागूऔषध चरेसजस्तो देखिने पदार्थ करिब १२१ किलोग्रामसहित २ जनालाई मंगलबार दिउँसो प्रहरीले पक्राउ गरेको हो ।&amp;nbsp;

